@Component({
  selector: 'app-main-nav',
  templateUrl: './main-nav.component.html',
  styleUrls: ['./main-nav.component.css']
})
export class MainNavComponent {
  isHide = false;
  isHandset$: Observable<boolean> = this.breakpointObserver.observe(Breakpoints.Handset)
    .pipe(
      map(result => result.matches),
      shareReplay()
    );



  constructor(private breakpointObserver: BreakpointObserver,iconRegistry: MatIconRegistry, sanitizer: DomSanitizer) {

    iconRegistry.addSvgIconLiteral('video-icon', sanitizer.bypassSecurityTrustHtml(VIDEO_ICON));
    iconRegistry.addSvgIconLiteral('image-icon', sanitizer.bypassSecurityTrustHtml(IMAGE_ICON));
    iconRegistry.addSvgIconLiteral('info-icon', sanitizer.bypassSecurityTrustHtml(INFO_ICON));
    iconRegistry.addSvgIconLiteral('estadistics-icon', sanitizer.bypassSecurityTrustHtml(ESTADISTICS_ICON));
    iconRegistry.addSvgIconLiteral('help-icon', sanitizer.bypassSecurityTrustHtml(HELP_ICON));
    iconRegistry.addSvgIconLiteral('exit-icon', sanitizer.bypassSecurityTrustHtml(EXIT_ICON));
  }

  hideLinks(){
    if(this.isHide == false){
      this.isHide = true;
    }else{
      this.isHide = false;
    }

  }
}
